// pages/jobBoard.js

import React from "react";

const jobBoard = () => {
	return (
		<div
			style={{
				display: "flex",
				justifyContent: "centre",
				alignItems: "centre",
				height: "100vh",
			}}
		>
			<h1>Job Board</h1>
		</div>
	);
};

export default jobBoard;
